/*!
 @const ASDKERRCalleeNotFound
 @abstract The call recipient was not available.
 */
const int ASDKERRCalleeNotFound;

/*!
 @const ASDKERRCalleeBusy
 @abstract The call recipient was unable to answer the call.
 */
const int ASDKERRCalleeBusy;

/*!
 @const ASDKERRCallCreationFailed
 @abstract The creation of the call failed.
 */
const int ASDKERRCallCreationFailed;

/*!
 @const ASDKERRCallFailed
 @abstract The call failed to complete.
 */
const int ASDKERRCallFailed;

/*!
 @const ASDKERRCSDKSessionFailure
 @abstract Failure to establish the Client SDK Session for Voice & Video media.
 */
const int ASDKERRCSDKSessionFailure;

/*!
 @const ASDKERRAssistSessionCreationFailure
 @abstract The Assist session failed to be created.
 */
const int ASDKERRAssistSessionCreationFailure;

/*!
 @const ASDKERRAssistTransportFailure
 @abstract The transport for the Assist session has failed.
 */
const int ASDKERRAssistTransportFailure;